// Available monomials (RR*V) = x*y^2*w^2,x*y*z*w^2,x*y*w^3,x*z^2*w^2,x*z*w^3,x*w^6,y^3*w^2,y^2*z*w^2,y^2*w^3,y*z^2*w^2,y*z*w^3,y*w^6,z^3*w^2,z^2*w^3,z*w^6,w^7,x,x*y^2,x*y*z,x*y*w,x*z^2,x*z*w,x*w^2,x*w^4,y,y^3,y^2*z,y^2*w,y*z^2,y*z*w,y*w^2,y*w^4,z,z^3,z^2*w,z*w^2,z*w^4,w,w^3,w^5,





void mexFunction(int nlhs, mxArray *plhs[], int nrhs, const mxArray *prhs[])
{
	if (nrhs != 1) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:inertial_array_R:nrhs", "One input required.");
	}
	if (nlhs != 1) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:inertial_array_R:nlhs", "One output required.");
	}    
	if (!mxIsDouble(prhs[0]) || mxIsComplex(prhs[0])) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:inertial_array_R:notDouble", "Input data must be type double.");
	}
	if(mxGetNumberOfElements(prhs[0]) % 48 != 0) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:inertial_array_R:incorrectSize", "Input size must be multiple of 48.");
	}
	int n_instances = mxGetNumberOfElements(prhs[0]) / 48;
	double *input = mxGetPr(prhs[0]);
	plhs[0] = mxCreateDoubleMatrix(4,24*n_instances,mxCOMPLEX);
	double* zr = mxGetPr(plhs[0]);
	double* zi = mxGetPi(plhs[0]);
	for(int k = 0; k < n_instances; k++) {
		const VectorXd data = Map<const VectorXd>(input + k*48, 48);
		MatrixXcd sols = solver_inertial_array_R(data);
		Index offset = k*sols.size();
		for (Index i = 0; i < sols.size(); i++) {
			zr[i+offset] = sols(i).real();
			zi[i+offset] = sols(i).imag();
		}
	}
}


